	testRunner.fail("Signature type invalid")
	return
}

if ( ! ( json."SignResponse"."SignatureObject"."Other"."sc.SignatureObjects"."sc.ExtendedSignatureObject"."Base64Signature"."\$"[9] ==~ /MI.*/ ) ) {
	testRunner.fail("Signature content invalid") 
	return
}

